    "classIntroduce": "药球是功能多样的训练器材，被广泛使用在体能训练中。Mad Slam 疯狂药球通过对课程动作的编排，设定了有效刺激全身肌肉的训练动作，不仅能够使身材紧致有型，还能收获有益于日常生活的运动技能。独特的释放类训练更是缓解压力的好方法。长期练习，可以加强体能水平，提高运动表现。",
    "video": "",
    "trainingEffect": "利用药球进行全身训练，让你的身材更加紧致有型<br/>使用独特的增强式训练提高爆发力<br/>通过循环训练提高产生力量和能量的能力<br/>在功能性训练中掌握运动模式，帮助安全有效的进行日常生活中的各类活动",
    "suitablePeople": "有塑形需求的人群<br/>想提高运动表现的人群<br/>希望学会多种训练工具的人群"
